import React from 'react';
import { Divider } from 'antd';

export default function Footer() {
  return (
    <div>
      <p style={{ textAlign: 'right', color: 'green' }}>
        by
        <a
          target="__blank"
          href="https://twitter.com/wale_bant"
          style={{ textAlign: 'right' }}
        >
          @wale_bant
        </a>
      </p>
    </div>
  );
}
